import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'

import NavBar from './components/NavBar/NavBar'
import Order from './components/Order/Order'

function App(props) {
  return (
    <BrowserRouter>
      <NavBar />

      <Route path="/" component={Order} exact={true} />
    </BrowserRouter>
  );
}

export default App
